import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import { AuthProvider, useAuth } from './contexts/AuthContext';
import Navbar from './components/Layout/Navbar';
import Home from './pages/Home';
import SimpleLogin from './pages/SimpleLogin';
import SimpleRegister from './pages/SimpleRegister';
import SimpleUserDashboard from './pages/SimpleUserDashboard';
import SimpleVendorDashboard from './pages/SimpleVendorDashboard';
import SimpleAdminDashboard from './pages/SimpleAdminDashboard';
import SimpleMealPlanner from './pages/SimpleMealPlanner';
import Products from './pages/Products';
import ProductDetail from './pages/ProductDetail';
import Orders from './pages/Orders';
import MealPlanner from './pages/MealPlanner';
import AdminDashboard from './pages/AdminDashboard';
import ApiTest from './pages/ApiTest';
import ProtectedRoute from './components/Auth/ProtectedRoute';
import AboutUs from './pages/AboutUs';
import Contact from './pages/Contact';
import APITest from './components/APITest';

const theme = createTheme({
  palette: {
    primary: { main: '#2E7D32', light: '#4CAF50', dark: '#1B5E20' },
    secondary: { main: '#FF6B35', light: '#FF8A65', dark: '#E65100' },
    background: { default: '#F5F5F5', paper: '#FFFFFF' },
  },
  typography: {
    fontFamily: '"Roboto", "Helvetica", "Arial", sans-serif',
    h1: { fontSize: '2.5rem', fontWeight: 600 },
    h2: { fontSize: '2rem', fontWeight: 600 },
    h3: { fontSize: '1.75rem', fontWeight: 600 },
  },
  shape: { borderRadius: 12 },
  components: {
    MuiButton: { styleOverrides: { root: { textTransform: 'none', borderRadius: 8, fontWeight: 500 } } },
    MuiCard: { styleOverrides: { root: { borderRadius: 16, boxShadow: '0 4px 20px rgba(0,0,0,0.1)' } } },
  },
});

function AppRoutes() {
  const { isAuthenticated, user } = useAuth(); // get login status and user info

  return (
    <>
      {/* Navbar shows for all pages */}
      <Navbar />

      <Routes>
        {/* Public routes */}
        <Route path="/login" element={<SimpleLogin />} />
        <Route path="/register" element={<SimpleRegister />} />

        {/* Home route: show dashboard if logged in */}
        <Route
          path="/"
          element={
            isAuthenticated && user.role === 'USER'
              ? <SimpleUserDashboard />
              : <Home />
          }
        />

        {/* Products */}
        <Route path="/products" element={<Products />} />
        <Route path="/products/:id" element={<ProductDetail />} />

        {/* About & Contact */}
        <Route path="/about-us" element={<AboutUs />} />
        <Route path="/contact" element={<Contact />} />

        {/* API Testing */}
        <Route path="/api-test" element={<ApiTest />} />
        <Route path="/debug-api" element={<APITest />} />

        {/* Protected routes for USER */}
        <Route
          path="/meal-planner"
          element={
            <ProtectedRoute requiredRole="USER">
              <MealPlanner />
            </ProtectedRoute>
          }
        />
        <Route
          path="/orders"
          element={
            <ProtectedRoute requiredRole="USER">
              <Orders />
            </ProtectedRoute>
          }
        />

        {/* Protected routes for VENDOR */}
        <Route
          path="/vendor/*"
          element={
            <ProtectedRoute requiredRole="VENDOR">
              <SimpleVendorDashboard />
            </ProtectedRoute>
          }
        />

        {/* Protected routes for ADMIN */}
        <Route
          path="/admin/*"
          element={
            <ProtectedRoute requiredRole="ADMIN">
              <AdminDashboard />
            </ProtectedRoute>
          }
        />
        <Route
          path="/user-management"
          element={
            <ProtectedRoute requiredRole="ADMIN">
              <UserManagement />
            </ProtectedRoute>
          }
        />

        {/* Fallback */}
        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
    </>
  );
}

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AuthProvider>
        <Router>
          <AppRoutes />
        </Router>
      </AuthProvider>
    </ThemeProvider>
  );
}

export default App;
